<!DOCTYPE html>

    <title></title>
    <meta charset="utf-8" />
    <link rel="stylesheet" type="text/css" href="../css/Theme1/phoenix.css" />
    <script type="text/javascript">
        function load() {
            var owner = findGetParameter("o")
            var chart = findGetParameter("c");
            document.getElementById(owner + chart).style.display = "block";
            document.getElementById("ucTitle_lblTitle").innerHTML = chart;
            var b = document.getElementById("back")
            b.href = b.href + owner;
        }
        function findGetParameter(parameterName) {
            var result = null,
                tmp = [];
            var items = location.search.substr(1).split("&");
            for (var index = 0; index < items.length; index++) {
                tmp = items[index].split("=");
                if (tmp[0] === parameterName) result = decodeURIComponent(tmp[1]);
            }
            return result;
        }
    </script>
</head>
